// src/components/Honeycomb.js
import React from 'react';
import './honeycomb.css';

const Honeycomb = ({ data }) => {
  const totalQuestions = data.reduce((sum, item) => sum + item.count, 0);

  const generateCells = () => {
    let cells = [];
    data.forEach((item) => {
      for (let i = 0; i < item.count; i++) {
        cells.push(
          <div
            key={`${item.difficulty}-${i}`}
            className={`honeycomb-cell ${item.difficulty}`}
            style={{ backgroundColor: item.color }}
          >
            <div className="percentage">{item.difficulty}</div>
          </div>
        );
      }
    });
    return cells;
  };

  return <div className="honeycomb">{generateCells()}</div>;
};

export default Honeycomb;
